import React from "react";
import { Box, Center } from "native-base";

export default function App() {
  return (
    <Center h="100vh" bg="coolGray.900">
      <Box h="150px" w="150px" roundedTopLeft="full" bg="white"></Box>
    </Center>
  );
}
